// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;

import "./IDeviceRegistry.sol";

/**
 * @title DeviceRegistry
 * @dev Manages device registration, guardian assignment, and device lifecycle
 * @notice Each device links a patient's IoT sensor to their guardian's wallet
 */
contract DeviceRegistry is IDeviceRegistry {
    
    // ============ State Variables ============
    
    /// @dev Mapping from deviceId to Device struct
    mapping(string => Device) private devices;
    
    /// @dev Mapping from guardian address to their device IDs
    mapping(address => string[]) private guardianDevices;
    
    /// @dev Mapping from patient address to their device IDs
    mapping(address => string[]) private patientDevices;
    
    /// @dev Mapping from guardian address to their display name
    mapping(address => string) public guardianNames;
    
    /// @dev Total number of registered devices
    uint256 public totalDevices;
    
    // ============ Modifiers ============
    
    modifier onlyPatient(string memory deviceId) {
        require(
            devices[deviceId].patient == msg.sender,
            "DeviceRegistry: Only patient can perform this action"
        );
        _;
    }
    
    modifier deviceExists(string memory deviceId) {
        require(
            devices[deviceId].patient != address(0),
            "DeviceRegistry: Device not registered"
        );
        _;
    }
    
    modifier deviceActive(string memory deviceId) {
        require(
            devices[deviceId].isActive,
            "DeviceRegistry: Device is not active"
        );
        _;
    }
    
    // ============ Core Functions ============
    
    /**
     * @notice Register a new IoT device
     * @dev Patient (msg.sender) registers their device and assigns a guardian
     * @param deviceId Unique device identifier (ESP32 UUID)
     * @param guardian Wallet address of the guardian
     * @param fullName Patient's full name
     * @param age Patient's age
     * @param homeLocation Patient's home GPS coordinates "lat,long"
     */
    function registerDevice(
        string memory deviceId,
        address guardian,
        string memory fullName,
        uint8 age,
        string memory homeLocation
    ) external override {
        _registerDeviceFor(deviceId, msg.sender, guardian, fullName, age, homeLocation);
    }
    
    /**
     * @notice Register a device on behalf of a patient
     * @dev Internal function to support both direct and delegated registration
     * @param deviceId Unique device identifier
     * @param patient Patient address
     * @param guardian Guardian address
     * @param fullName Patient's full name
     * @param age Patient's age
     * @param homeLocation Patient's home GPS coordinates "lat,long"
     */
    function registerDeviceFor(
        string memory deviceId,
        address patient,
        address guardian,
        string memory fullName,
        uint8 age,
        string memory homeLocation
    ) external {
        _registerDeviceFor(deviceId, patient, guardian, fullName, age, homeLocation);
    }
    
    /**
     * @dev Internal registration logic
     */
    function _registerDeviceFor(
        string memory deviceId,
        address patient,
        address guardian,
        string memory fullName,
        uint8 age,
        string memory homeLocation
    ) internal {
        require(
            devices[deviceId].patient == address(0),
            "DeviceRegistry: Device already registered"
        );
        require(
            guardian != address(0),
            "DeviceRegistry: Invalid guardian address"
        );
        require(
            patient != address(0),
            "DeviceRegistry: Invalid patient address"
        );
        require(
            bytes(deviceId).length >= 8,
            "DeviceRegistry: Device ID too short (min 8 chars)"
        );
        
        devices[deviceId] = Device({
            deviceId: deviceId,
            patient: patient,
            guardian: guardian,
            fullName: fullName,
            age: age,
            homeLocation: homeLocation,
            isActive: true,
            registeredAt: block.timestamp
        });
        
        guardianDevices[guardian].push(deviceId);
        patientDevices[patient].push(deviceId);
        
        totalDevices++;
        
        emit DeviceRegistered(deviceId, patient, guardian, block.timestamp);
    }
    
    /**
     * @notice Change the guardian for a device
     * @dev Only the patient can change their guardian
     * @param deviceId Device to update
     * @param newGuardian New guardian wallet address
     */
    function changeGuardian(
        string memory deviceId,
        address newGuardian
    ) external override onlyPatient(deviceId) deviceExists(deviceId) {
        require(
            newGuardian != address(0),
            "DeviceRegistry: Invalid guardian address"
        );
        
        address oldGuardian = devices[deviceId].guardian;
        devices[deviceId].guardian = newGuardian;
        
        // Add to new guardian's list
        guardianDevices[newGuardian].push(deviceId);
        
        emit GuardianChanged(deviceId, oldGuardian, newGuardian, block.timestamp);
    }
    
    /**
     * @notice Change guardian on behalf of patient (called from PatientMonitor)
     * @param deviceId Device to update
     * @param newGuardian New guardian wallet address
     * @param patient Patient address to verify
     */
    function changeGuardianFor(
        string memory deviceId,
        address newGuardian,
        address patient
    ) external deviceExists(deviceId) {
        require(
            devices[deviceId].patient == patient,
            "DeviceRegistry: Only patient can change guardian"
        );
        require(
            newGuardian != address(0),
            "DeviceRegistry: Invalid guardian address"
        );
        
        address oldGuardian = devices[deviceId].guardian;
        devices[deviceId].guardian = newGuardian;
        
        // Add to new guardian's list
        guardianDevices[newGuardian].push(deviceId);
        
        emit GuardianChanged(deviceId, oldGuardian, newGuardian, block.timestamp);
    }
    
    /**
     * @notice Deactivate a device
     * @dev Can be called by patient or guardian. Gas-optimized with memory caching.
     * @param deviceId Device to deactivate
     */
    function deactivateDevice(
        string memory deviceId
    ) external override deviceExists(deviceId) {
        // Cache device in memory to avoid redundant storage reads
        Device memory device = devices[deviceId];
        require(
            device.patient == msg.sender || 
            device.guardian == msg.sender,
            "DeviceRegistry: Not authorized"
        );
        
        devices[deviceId].isActive = false;
        
        emit DeviceDeactivated(deviceId, block.timestamp);
    }
    
    // ============ View Functions ============
    
    /**
     * @notice Get device information
     * @param deviceId Device identifier
     * @return Device struct with all device details
     */
    function getDevice(
        string memory deviceId
    ) external view override returns (Device memory) {
        return devices[deviceId];
    }
    
    /**
     * @notice Get all devices for a guardian
     * @param guardian Guardian wallet address
     * @return Array of device IDs
     */
    function getGuardianDevices(
        address guardian
    ) external view returns (string[] memory) {
        return guardianDevices[guardian];
    }
    
    /**
     * @notice Get all devices for a patient
     * @param patient Patient wallet address
     * @return Array of device IDs
     */
    function getPatientDevices(
        address patient
    ) external view returns (string[] memory) {
        return patientDevices[patient];
    }
    
    /**
     * @notice Check if device is registered
     * @param deviceId Device identifier
     * @return True if registered
     */
    function isDeviceRegistered(
        string memory deviceId
    ) external view override returns (bool) {
        return devices[deviceId].patient != address(0);
    }
    
    /**
     * @notice Check if device is active
     * @param deviceId Device identifier
     * @return True if active
     */
    function isDeviceActive(
        string memory deviceId
    ) external view override returns (bool) {
        return devices[deviceId].isActive;
    }
    
    /**
     * @notice Get device guardian address
     * @param deviceId Device identifier
     * @return Guardian wallet address
     */
    function getDeviceGuardian(
        string memory deviceId
    ) external view returns (address) {
        return devices[deviceId].guardian;
    }
    
    /**
     * @notice Get device patient address
     * @param deviceId Device identifier
     * @return Patient wallet address
     */
    function getDevicePatient(
        string memory deviceId
    ) external view returns (address) {
        return devices[deviceId].patient;
    }
    
    /**
     * @notice Set display name for guardian
     * @dev Guardian can set their own display name to be shown across all devices
     * @param name Display name (e.g., "Dr. Smith", "Mom", "John Doe")
     */
    function setGuardianName(string memory name) external {
        require(
            bytes(name).length > 0,
            "DeviceRegistry: Name cannot be empty"
        );
        require(
            bytes(name).length <= 50,
            "DeviceRegistry: Name too long (max 50 chars)"
        );
        
        guardianNames[msg.sender] = name;
        
        emit GuardianNameSet(msg.sender, name, block.timestamp);
    }
    
    /**
     * @notice Get guardian's display name
     * @param guardian Guardian wallet address
     * @return Display name or empty string if not set
     */
    function getGuardianName(
        address guardian
    ) external view returns (string memory) {
        return guardianNames[guardian];
    }
    
    /**
     * @dev Reject direct ETH transfers to prevent accidental loss
     */
    receive() external payable {
        revert("DeviceRegistry: ETH not accepted");
    }
}

contracts/EventLogger.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;

import "./IEventLogger.sol";
import "./IDeviceRegistry.sol";

/**
 * @title EventLogger
 * @dev Logs health event hashes on-chain for immutable verification
 * @notice Stores only SHA-256 hashes; full data lives in GunDB (P2P storage)
 */
contract EventLogger is IEventLogger {
    
    // ============ State Variables ============
    
    /// @dev Array of all event logs
    EventLog[] private eventLogs;
    
    /// @dev Mapping from deviceId to array of event indices
    mapping(string => uint256[]) private deviceEventIndices;
    
    /// @dev Reference to DeviceRegistry contract
    IDeviceRegistry public deviceRegistry;
    
    /// @dev Total number of events logged
    uint256 public totalEvents;
    
    // ============ Constructor ============
    
    /**
     * @notice Initialize with DeviceRegistry contract address
     * @param _deviceRegistry Address of the DeviceRegistry contract
     */
    constructor(address _deviceRegistry) {
        require(
            _deviceRegistry != address(0),
            "EventLogger: Invalid registry address"
        );
        deviceRegistry = IDeviceRegistry(_deviceRegistry);
    }
    
    // ============ Modifiers ============
    
    modifier deviceRegistered(string memory deviceId) {
        require(
            deviceRegistry.isDeviceRegistered(deviceId),
            "EventLogger: Device not registered"
        );
        _;
    }
    
    modifier deviceActive(string memory deviceId) {
        require(
            deviceRegistry.isDeviceActive(deviceId),
            "EventLogger: Device is not active"
        );
        _;
    }
    
    // ============ Core Functions ============
    
    /**
     * @notice Log a health event on-chain
     * @dev Stores only the hash; full data is in GunDB. Only patient/guardian can log.
     * @param deviceId Device that generated the event
     * @param dataHash SHA-256 hash of full event data
     * @param eventType Event severity: "normal", "alert", or "critical"
     */
    function logEvent(
        string memory deviceId,
        bytes32 dataHash,
        string memory eventType
    ) external override deviceRegistered(deviceId) deviceActive(deviceId) {
        _logEventInternal(msg.sender, deviceId, dataHash, eventType);
    }
    
    /**
     * @notice Log event on behalf of another address (for delegated calls)
     * @dev Used when PatientMonitor contract delegates to this contract
     * @param caller The original caller address
     * @param deviceId Device that generated the event
     * @param dataHash SHA-256 hash of full event data
     * @param eventType Event severity: "normal", "alert", or "critical"
     */
    function logEventFrom(
        address caller,
        string memory deviceId,
        bytes32 dataHash,
        string memory eventType
    ) external override deviceRegistered(deviceId) deviceActive(deviceId) {
        _logEventInternal(caller, deviceId, dataHash, eventType);
    }
    
    /**
     * @dev Internal function to log events
     */
    function _logEventInternal(
        address caller,
        string memory deviceId,
        bytes32 dataHash,
        string memory eventType
    ) private {
        // Get device info from registry
        IDeviceRegistry.Device memory device = deviceRegistry.getDevice(deviceId);
        
        // ACCESS CONTROL: Only patient or guardian can log events
        require(
            caller == device.patient || caller == device.guardian,
            "EventLogger: Only patient or guardian can log events"
        );
        
        // Validate event type using enum-like comparison
        bytes32 typeHash = keccak256(bytes(eventType));
        require(
            typeHash == keccak256(bytes("normal")) ||
            typeHash == keccak256(bytes("alert")) ||
            typeHash == keccak256(bytes("critical")),
            "EventLogger: Invalid event type"
        );
        
        // Create event log
        EventLog memory newEvent = EventLog({
            deviceId: deviceId,
            dataHash: dataHash,
            guardian: device.guardian,
            eventType: eventType,
            timestamp: block.timestamp
        });
        
        // Store event
        eventLogs.push(newEvent);
        uint256 eventIndex = eventLogs.length - 1;
        deviceEventIndices[deviceId].push(eventIndex);
        
        totalEvents++;
        
        emit EventLogged(
            deviceId,
            device.guardian,
            dataHash,
            eventType,
            block.timestamp
        );
    }
    
    // ============ View Functions ============
    
    /**
     * @notice Get event by index
     * @param index Event index in the logs array
     * @return EventLog struct
     */
    function getEvent(
        uint256 index
    ) external view override returns (EventLog memory) {
        require(
            index < eventLogs.length,
            "EventLogger: Event index out of bounds"
        );
        return eventLogs[index];
    }
    
    /**
     * @notice Get latest N events for a device (paginated)
     * @param deviceId Device identifier
     * @param limit Maximum number of events to return (max 100)
     * @return Array of EventLog structs (most recent first)
     */
    function getDeviceEvents(
        string memory deviceId,
        uint256 limit
    ) external view override returns (EventLog[] memory) {
        // PAGINATION: Enforce maximum limit to prevent gas issues
        require(limit > 0 && limit <= 100, "EventLogger: Limit must be 1-100");
        
        uint256[] memory indices = deviceEventIndices[deviceId];
        uint256 count = indices.length > limit ? limit : indices.length;
        
        EventLog[] memory events = new EventLog[](count);
        
        // Return in reverse order (most recent first)
        for (uint256 i = 0; i < count; i++) {
            uint256 index = indices[indices.length - 1 - i];
            events[i] = eventLogs[index];
        }
        
        return events;
    }
    
    /**
     * @notice Get all event indices for a device
     * @param deviceId Device identifier
     * @return Array of event indices
     */
    function getDeviceEventIndices(
        string memory deviceId
    ) external view returns (uint256[] memory) {
        return deviceEventIndices[deviceId];
    }
    
    /**
     * @notice Get total event count for a device
     * @param deviceId Device identifier
     * @return Number of events
     */
    function getDeviceEventCount(
        string memory deviceId
    ) external view override returns (uint256) {
        return deviceEventIndices[deviceId].length;
    }
    
    /**
     * @notice Get all events (paginated)
     * @param offset Starting index
     * @param limit Number of events to return (max 100)
     * @return Array of EventLog structs
     */
    function getAllEvents(
        uint256 offset,
        uint256 limit
    ) external view returns (EventLog[] memory) {
        require(
            offset < eventLogs.length,
            "EventLogger: Offset out of bounds"
        );
        require(limit > 0 && limit <= 100, "EventLogger: Limit must be 1-100");
        
        uint256 end = offset + limit;
        if (end > eventLogs.length) {
            end = eventLogs.length;
        }
        
        uint256 count = end - offset;
        EventLog[] memory events = new EventLog[](count);
        
        for (uint256 i = 0; i < count; i++) {
            events[i] = eventLogs[offset + i];
        }
        
        return events;
    }
    
    /**
     * @notice Verify event data matches stored hash
     * @param index Event index
     * @param dataHash Hash to verify
     * @return True if hash matches
     */
    function verifyEventHash(
        uint256 index,
        bytes32 dataHash
    ) external view returns (bool) {
        require(
            index < eventLogs.length,
            "EventLogger: Event index out of bounds"
        );
        return eventLogs[index].dataHash == dataHash;
    }
    
    /**
     * @dev Reject direct ETH transfers to prevent accidental loss
     */
    receive() external payable {
        revert("EventLogger: ETH not accepted");
    }
}

contracts/IDeviceRegistry.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;

/**
 * @title IDeviceRegistry
 * @dev Interface for device registration and management
 */
interface IDeviceRegistry {
    
    struct Device {
        string deviceId;
        address patient;
        address guardian;
        string fullName;
        uint8 age;
        string homeLocation;
        bool isActive;
        uint256 registeredAt;
    }
    
    event DeviceRegistered(
        string indexed deviceId,
        address indexed patient,
        address indexed guardian,
        uint256 timestamp
    );
    
    event GuardianChanged(
        string indexed deviceId,
        address oldGuardian,
        address newGuardian,
        uint256 timestamp
    );
    
    event DeviceDeactivated(
        string indexed deviceId,
        uint256 timestamp
    );
    
    event GuardianNameSet(
        address indexed guardian,
        string name,
        uint256 timestamp
    );
    
    function registerDevice(string memory deviceId, address guardian, string memory fullName, uint8 age, string memory homeLocation) external;
    function registerDeviceFor(string memory deviceId, address patient, address guardian, string memory fullName, uint8 age, string memory homeLocation) external;
    function changeGuardian(string memory deviceId, address newGuardian) external;
    function deactivateDevice(string memory deviceId) external;
    function getDevice(string memory deviceId) external view returns (Device memory);
    function isDeviceRegistered(string memory deviceId) external view returns (bool);
    function isDeviceActive(string memory deviceId) external view returns (bool);
    function setGuardianName(string memory name) external;
    function getGuardianName(address guardian) external view returns (string memory);
}

